import './ContactLink.css'

import React from 'react';
import { Link } from 'react-router-dom';

const ContactLink = () => {
    return (
        <div className='contact-link'>
          
                <Link to="/get-in-contact">Entrar em contato</Link>
        
        </div>
    );
};

export default ContactLink;
